<script>

    import Title from '../utils/title.svelte';

    let annotationOn = false;

    let f2v_message_on = false;
    let f2v_arrow_on = false;
    let v2f_message_on = false;
    let v2f_arrow_on = false;
    let factor_neighbour_messages_on = false;
    let factor_neighbour_arrow_on = false;
    let var_neighbour_messages_on = false;
    let var_neighbour_arrow_on = false;

    let var_incoming_messages_on = false;


    let adj_vars_selected = false;
    let adj_vars_selected2 = false;
    let adj_factors_selected = false;
    let factor_selected = false;
    let all_factors_selected = false;
    let belief_selected = false;

    function toggleAnnotation() {
        annotationOn = !annotationOn;
    }

	function handleMouseOver(e) {
        let group = e.composedPath().find((element) => element.classList[0] == "node_g");

        if (group.id == "factor to variable message") {
            f2v_message_on = true;
            f2v_arrow_on = true;
        } else if (group.id == "variable to factor message") {
            v2f_message_on = true;
            v2f_arrow_on = true;
        } else if (group.id == "other variables to factor message") {
            factor_neighbour_messages_on = true;
            factor_neighbour_arrow_on = true;
        } else if (group.id == "other factors to variable message") {
            var_neighbour_messages_on = true;
            var_neighbour_arrow_on = true;
        } else if (group.id == "variable incoming messages") {
            var_incoming_messages_on = true;
            f2v_arrow_on = true;
            var_neighbour_arrow_on = true;
        } else if (group.id == "adjacent variables") {
            adj_vars_selected = true;
        } else if (group.id == "adjacent variables 2") {
            adj_vars_selected2 = true;
        } else if (group.id == "adjacent factors") {
            adj_factors_selected = true;
        } else if (group.id == "all factors") {
            all_factors_selected = true;
        } else if (group.id == "factor") {
            factor_selected = true;
        } else if (group.id == "belief") {
            belief_selected = true;
        }
	}
	function handleMouseOut(e) {
        let group = e.composedPath().find((element) => element.classList[0] == "node_g");

        if (group.id == "factor to variable message") {
            f2v_message_on = false;
            f2v_arrow_on = false;
        } else if (group.id == "variable to factor message") {
            v2f_message_on = false;
            v2f_arrow_on = false;
        } else if (group.id == "other variables to factor message") {
            factor_neighbour_messages_on = false;
            factor_neighbour_arrow_on = false;
        } else if (group.id == "other factors to variable message") {
            var_neighbour_messages_on = false;
            var_neighbour_arrow_on = false;
        } else if (group.id == "variable incoming messages") {
            var_incoming_messages_on = false;
            f2v_arrow_on = false;
            var_neighbour_arrow_on = false;
        } else if (group.id == "adjacent variables") {
            adj_vars_selected = false;
        } else if (group.id == "adjacent variables 2") {
            adj_vars_selected2 = false;
        } else if (group.id == "adjacent factors") {
            adj_factors_selected = false;
        } else if (group.id == "all factors") {
            all_factors_selected = false;
        } else if (group.id == "factor") {
            factor_selected = false;
        } else if (group.id == "belief") {
            belief_selected = false;
        }
    }
    
</script>

